import React, { Component } from 'react';
import './App.css';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import Navbar from './Components/NavbarComponent';

class App extends Component {
  render() {
    return (
      {Navbar}
    );
  }
}

export default App;
